import Head from 'next/head';
import Navbar from "./Navbar";

const Layout = (props) => (
  <div>
    <Head>
      <title>
        Indiana General Assembly, 2020 Session
      </title>
    </Head>
    <Navbar/>
    {props.children}
  </div>
);

export default Layout;
